import { backendAPI } from '../../api';

class PhotoService {
  async getAll() {
    const photos = await backendAPI.get('photos');
    return photos.data;
  }

  async getByID(photoID) {
    const photo = await backendAPI.get(`photos/${photoID}`);
    return photo.data;
  }

}

export const photoService = new PhotoService();
